import { createAppContainer } from 'react-navigation';
import { createStackNavigator } from 'react-navigation-stack';
import HomeScreen from './src/screens/HomeScreen'
import DataStructures from './src/screens/DataStructures'
import WishScreen from './src/screens/WishScreen'
import MicrocontrollerScreen from './src/screens/MicrocontrollerScreen';
import ProgrammingScreen from './src/screens/ProgrammingScreen';

const navigator = createStackNavigator(
  {
    Home: HomeScreen,
    Data: DataStructures,
    Wish: WishScreen,
    Micro: MicrocontrollerScreen,
    Programming: ProgrammingScreen,
  },
  {
    initialRouteName: 'Home',
    defaultNavigationOptions: {
      title: 'MCQ Exam App',
    },
  }
);

export default createAppContainer(navigator);
